import React, { useState } from "react";
import "./App.css";
import { Input, Button } from "reactstrap";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = { entries: "" };
    this.handleClick = this.handleClick.bind(this);
  }

  handleClick(event) {
    const serverUrl = "http://localhost:5000";
    fetch(serverUrl + "/read/all", { method: "GET" }).then((response) => {
      return response.json().then((object) => {
        this.setState({
          entries: Object.entries(object),
        });
      });

    console.log(event.target.id);
  });

  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <ul>
            {Object.entries(this.state.entries).map(([key, value]) => (
              <li>
                <span>
                  {Object.values(this.state.entries[key][0])}:
                  {Object.keys(this.state.entries[key][1])[0]},
                  {Object.values(this.state.entries[key][1])}
                </span>
              </li>
            ))}
          </ul>
          <Button color="success" onClick={this.handleClick} id="readAll">
            read all
          </Button>
        </header>
      </div>
    );
  }
}

export default App;
